import { Carousel } from "antd";

const CarouselComp = () => {
  return (
    <div id="MyCarousel">
      <style>
        {`
                #MyCarousel .img{
                    height:450px;
                    width: 100%;
                    overflow:hidden                    
                }
                #MyCarousel img{
                    width:100%;
                }
            `}
      </style>

      <div>
        <h1>The New Way to Design Your Home</h1>
        <p></p>
      </div>
      <Carousel autoplay>
        <div className="img">
          <img src="/images/house1.jpg" alt="house1" />
        </div>
        <div className="img">
          <img src="/images/house2.jpg" alt="house1" />
        </div>
        <div className="img">
          <img src="/images/house3.jpg" alt="house1" />
        </div>
      </Carousel>
    </div>
  );
};

export default CarouselComp;
